SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/RailwayTunnel> .
	?Seed 	 <http://dbpedia.org/ontology/railwayLineUsingTunnel> 	 ?count . 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) <= 6)

SELECT DISTINCT ?Seed WHERE{
	 ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/RailwayTunnel> . 
	MINUS{ 
		{?Seed 	 <http://dbpedia.org/ontology/length> 	 3169.92 .} UNION 
		{?Seed 	 <http://dbpedia.org/ontology/railwayLineUsingTunnel> 	 <http://dbpedia.org/resource/IND_Culver_Line> .} 
	} 
}

